import { Outlet } from 'react-router-dom'
import './index.scss'

const Home = () => {
    return (
        <div className='Container Home-Page'>
            <img src='' alt='Mi carita'/>
            
            <div className='Text-Zone'>
                <h1>
                    Fede Moya <br/>
                    Front-End Dev
                </h1>
            </div>

            <Outlet/>
        </div>
    );
}

export default Home;
